import React from "react";
import PropTypes from "prop-types";
import FlightChooser from "./flightChooser";
import { withStyles } from "@material-ui/core/styles";
import LandingText from "./landingText";
import BelowLanding from "./belowLanding";
import NumberCrunch from "./numbercrunch";
import SoFunktionierts from "./sofunktionierts";
import TopPicture from "./toppicture";
import Faqpic from "./faqpic";
import Faqmenu from "./faqmenu";
import BottomMenu from "./bottommenu";

const styles = theme => ({
  container: {
    display: "flex",
    flexWrap: "wrap",
    position: "relative",
    direction: "column"
  },
  dense: {
    marginTop: 19
  },
  menu: {
    width: 200
  },
  flight: {}
});

class Landing extends React.Component {
  constructor() {
    super();
    this.state = {
      name: "",
      date: "",
      multiline: "Controlled",
      flightClass: "flightClass",
      chooser: "choose"
    };
    this.checkNoAndDate = this.checkNoAndDate.bind(this);
  }

  handleChange = name => event => {
    this.setState({
      [name]: event.target.value
    });
  };
  checkNoAndDate(e, param) {
    console.log("I am some function and those are my params:\n");
    console.log(param);
  }

  render() {
    const { classes } = this.props;

    return (
      <div className={`${classes.container} ${this.state.landing}`}>
        <TopPicture />
        <LandingText />

        <FlightChooser checkNoAndDate={this.checkNoAndDate} />

        <BelowLanding />
        <NumberCrunch />
        <SoFunktionierts />
        <Faqpic />
        <Faqmenu />
        <BottomMenu />
      </div>
    );
  }
}

Landing.propTypes = {
  classes: PropTypes.object.isRequired
};

export default withStyles(styles)(Landing);
